// frontend/src/pages/Submissions.jsx
import React, { useState, useEffect } from 'react';
import { useAuth } from '../contexts/AuthContext';
import { submissionService } from '../services/submission';

const Submissions = () => {
    const [submissions, setSubmissions] = useState([]);
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState(null);
    const [alert, setAlert] = useState(null);
    const [showForm, setShowForm] = useState(false);
    const [formData, setFormData] = useState({
        type: 'MATERIAL',
        title: '',
        content: '',
        fileUrl: ''
    });

    const { user } = useAuth();

    useEffect(() => {
        loadSubmissions();
    }, []);

    const loadSubmissions = async () => {
        try {
            setLoading(true);
            setError(null);

            const response = await submissionService.getUserSubmissions();

            // Ensure we have an array from the response
            const submissionsData = response?.data || [];
            setSubmissions(Array.isArray(submissionsData) ? submissionsData : []);

        } catch (error) {
            console.error('Error loading submissions:', error);
            setError('Failed to load submissions');
            setSubmissions([]); // Set empty array as fallback
        } finally {
            setLoading(false);
        }
    };

    const handleInputChange = (e) => {
        const { name, value } = e.target;
        setFormData(prev => ({
            ...prev,
            [name]: value
        }));
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        try {
            await submissionService.createSubmission(formData);
            setAlert({ type: 'success', message: 'Submission created successfully!' });
            setShowForm(false);
            setFormData({
                type: 'MATERIAL',
                title: '',
                content: '',
                fileUrl: ''
            });
            loadSubmissions();
        } catch (error) {
            console.error('Error creating submission:', error);
            setAlert({ type: 'error', message: 'Failed to create submission' });
        }

        // Clear alert after 3 seconds
        setTimeout(() => setAlert(null), 3000);
    };

    const getStatusBadge = (status) => {
        const statusClasses = {
            'PENDING': 'badge bg-warning text-dark',
            'APPROVED': 'badge bg-success',
            'REJECTED': 'badge bg-danger'
        };
        return statusClasses[status] || 'badge bg-secondary';
    };

    const getTypeIcon = (type) => {
        return type === 'MATERIAL' ? 'fas fa-file-alt' : 'fas fa-building';
    };

    const formatDate = (dateString) => {
        if (!dateString) return 'Unknown date';
        return new Date(dateString).toLocaleDateString('en-US', {
            year: 'numeric',
            month: 'short',
            day: 'numeric',
            hour: '2-digit',
            minute: '2-digit'
        });
    };

    if (loading) {
        return (
            <div className="submissions-loading">
                <div className="loading-content">
                    <div className="loading-spinner"></div>
                    <p>Loading submissions...</p>
                </div>
            </div>
        );
    }

    return (
        <div className="submissions-page">
            <div className="container">
                <div className="page-header">
                    <div className="header-content">
                        <h1 className="page-title">
                            <i className="fas fa-paper-plane"></i>
                            My Submissions
                        </h1>
                        <p className="page-subtitle">
                            Track your material and facility submissions
                        </p>
                    </div>
                    <div className="header-actions">
                        <button
                            className="btn btn-primary"
                            onClick={() => setShowForm(!showForm)}
                        >
                            <i className={`fas ${showForm ? 'fa-times' : 'fa-plus'}`}></i>
                            {showForm ? 'Cancel' : 'New Submission'}
                        </button>
                    </div>
                </div>

                {/* Statistics */}
                <div className="stats-grid">
                    <div className="stat-item">
                        <span className="stat-number">{submissions.length}</span>
                        <span className="stat-label">Total Submissions</span>
                    </div>
                    <div className="stat-item">
                        <span className="stat-number">{submissions.filter(s => s.status === 'PENDING').length}</span>
                        <span className="stat-label">Pending</span>
                    </div>
                    <div className="stat-item">
                        <span className="stat-number">{submissions.filter(s => s.status === 'APPROVED').length}</span>
                        <span className="stat-label">Approved</span>
                    </div>
                    <div className="stat-item">
                        <span className="stat-number">{submissions.filter(s => s.status === 'REJECTED').length}</span>
                        <span className="stat-label">Rejected</span>
                    </div>
                </div>

                {/* Alert */}
                {alert && (
                    <div className={`alert alert-${alert.type === 'error' ? 'danger' : alert.type}`}>
                        <i className={`fas ${alert.type === 'success' ? 'fa-check-circle' : 'fa-exclamation-triangle'}`}></i>
                        {alert.message}
                        <button className="alert-close" onClick={() => setAlert(null)}>×</button>
                    </div>
                )}

                {/* Error */}
                {error && (
                    <div className="alert alert-danger">
                        <i className="fas fa-exclamation-triangle"></i>
                        {error}
                        <button className="alert-close" onClick={() => setError(null)}>×</button>
                    </div>
                )}

                {/* Submission Form */}
                {showForm && (
                    <div className="submission-form-card">
                        <div className="card">
                            <div className="card-header">
                                <h5>Create New Submission</h5>
                            </div>
                            <div className="card-body">
                                <form onSubmit={handleSubmit}>
                                    <div className="row">
                                        <div className="col-md-6">
                                            <div className="mb-3">
                                                <label htmlFor="type" className="form-label">
                                                    <i className="fas fa-tag"></i> Type
                                                </label>
                                                <select
                                                    className="form-select"
                                                    id="type"
                                                    name="type"
                                                    value={formData.type}
                                                    onChange={handleInputChange}
                                                    required
                                                >
                                                    <option value="MATERIAL">Material Submission</option>
                                                    <option value="FASILITAS">Facility Request</option>
                                                </select>
                                            </div>
                                        </div>
                                        <div className="col-md-6">
                                            <div className="mb-3">
                                                <label htmlFor="title" className="form-label">
                                                    <i className="fas fa-heading"></i> Title
                                                </label>
                                                <input
                                                    type="text"
                                                    className="form-control"
                                                    id="title"
                                                    name="title"
                                                    value={formData.title}
                                                    onChange={handleInputChange}
                                                    placeholder="Enter submission title"
                                                    required
                                                />
                                            </div>
                                        </div>
                                    </div>

                                    <div className="mb-3">
                                        <label htmlFor="content" className="form-label">
                                            <i className="fas fa-align-left"></i> Description
                                        </label>
                                        <textarea
                                            className="form-control"
                                            id="content"
                                            name="content"
                                            rows="4"
                                            value={formData.content}
                                            onChange={handleInputChange}
                                            placeholder="Describe your submission..."
                                            required
                                        ></textarea>
                                    </div>

                                    <div className="mb-3">
                                        <label htmlFor="fileUrl" className="form-label">
                                            <i className="fas fa-link"></i> File URL (Optional)
                                        </label>
                                        <input
                                            type="url"
                                            className="form-control"
                                            id="fileUrl"
                                            name="fileUrl"
                                            value={formData.fileUrl}
                                            onChange={handleInputChange}
                                            placeholder="https://example.com/file.pdf"
                                        />
                                    </div>

                                    <div className="form-actions">
                                        <button type="submit" className="btn btn-primary">
                                            <i className="fas fa-paper-plane"></i>
                                            Submit
                                        </button>
                                        <button
                                            type="button"
                                            className="btn btn-secondary"
                                            onClick={() => setShowForm(false)}
                                        >
                                            <i className="fas fa-times"></i>
                                            Cancel
                                        </button>
                                    </div>
                                </form>
                            </div>
                        </div>
                    </div>
                )}

                {/* Submissions Grid */}
                <div className="submissions-grid">
                    {submissions.length === 0 ? (
                        <div className="empty-state">
                            <div className="empty-icon">
                                <i className="fas fa-paper-plane"></i>
                            </div>
                            <h3>No submissions yet</h3>
                            <p>Create your first submission to get started!</p>
                            <button
                                className="btn btn-primary"
                                onClick={() => setShowForm(true)}
                            >
                                <i className="fas fa-plus"></i>
                                Create Submission
                            </button>
                        </div>
                    ) : (
                        submissions.map((submission) => (
                            <div key={submission.submissionId} className="submission-card">
                                <div className="card h-100">
                                    <div className="card-header">
                                        <div className="submission-header">
                                            <div className="submission-type">
                                                <i className={getTypeIcon(submission.type)}></i>
                                                <span className="badge bg-primary">{submission.type}</span>
                                            </div>
                                            <span className={getStatusBadge(submission.status)}>
                                                {submission.status}
                                            </span>
                                        </div>
                                    </div>

                                    <div className="card-body">
                                        <h5 className="card-title">{submission.title}</h5>
                                        <p className="card-text">{submission.content}</p>

                                        {submission.fileUrl && (
                                            <div className="submission-file">
                                                <a
                                                    href={submission.fileUrl}
                                                    target="_blank"
                                                    rel="noopener noreferrer"
                                                    className="btn btn-outline-primary btn-sm"
                                                >
                                                    <i className="fas fa-external-link-alt"></i>
                                                    View File
                                                </a>
                                            </div>
                                        )}
                                    </div>

                                    <div className="card-footer">
                                        <div className="submission-meta">
                                            <small className="text-muted">
                                                <i className="fas fa-clock"></i>
                                                Submitted: {formatDate(submission.submittedAt)}
                                            </small>
                                            <div className="submission-actions">
                                                <button className="btn btn-sm btn-outline-secondary">
                                                    <i className="fas fa-eye"></i>
                                                    View Details
                                                </button>
                                            </div>
                                        </div>
                                    </div>
                                </div>
                            </div>
                        ))
                    )}
                </div>
            </div>
        </div>
    );
};

export default Submissions;
